import React, { useState } from 'react';

// Create Accordion using React:

const App = () => {
  const [one, two] = useState();

  const inputEvent = (e) => {
    two(e.target.value);
  };
  return (
    <>
      <div className="main_div">
        <div className="center_div">
          <h1>React ToDo List</h1>
          <input onChange={inputEvent} />
          <button>Click Me</button>

          <ul>
            <li>{one}</li>
          </ul>
        </div>
      </div>
    </>
  );
};

export default App;
